INSERT INTO `notice` VALUES ('1', '疫情提醒', '近期，新型冠状病毒肺炎疫情在全国范围内爆发，为了保障社区居民的健康和安全，我们特别提醒您：\r\n减少外出，尽量避免前往人员密集的场所，如商场、影院等；\r\n勤洗手，保持手部卫生，避免触摸口鼻眼等易感染病毒的部位；\r\n佩戴口罩，特别是在人员密集场所、公共交通工具上；\r\n保持室内通风，定期消毒，保持室内环境清洁卫生；\r\n如有发热、咳嗽、呼吸急促等症状，请及时就医，并告知医生最近是否有过接触疫情地区人员的情况。\r\n我们将密切关注疫情动态，加强社区疫情防控措施，全力保障社区居民的健康和安全。同时，我们也希望居民们积极配合，共同营造安全、和谐的社区环境。\r\n谢谢大家的支持和配合！', '2023-04-07', '广西大学社区', '13001399778');
INSERT INTO `notice` VALUES ('10', '共同抗击疫情，保障社区安全', '近期，新冠疫情在全国多地出现新的确诊病例。为了保障社区居民的健康和安全，我们特地向大家发出以下公告：\r\n请居民们保持良好的卫生习惯，勤洗手、戴口罩、避免聚集等，减少感染病毒的风险。\r\n如出现发热、咳嗽、乏力等症状，请及时前往社区医院进行检查和治疗，并主动向社区工作人员报告。\r\n居民们应积极配合社区工作人员进行健康状态和出行情况的登记和报告，以便于及时掌握疫情动态和采取相应的防控措施。\r\n请居民们避免前往疫情高风险地区，如确需前往，请提前向社区工作人员报告，接受健康检查和指导。\r\n社区将加强巡查和管理，对疑似病例和密切接触者进行隔离和观察，并开展消毒、通风等防控措施，保障社区居民的健康和安全。\r\n以上公告仅供参考，具体防控措施和管理要求以社区工作人员的通知为准。希望居民们共同配合，共同抗击疫情，保障社区的健康和安全！\r\n谢谢大家的支持和理解！', '2023-04-17', '广西大学社区', '13003043824');
